Competition is 90% mental.

Stepping into any competitive arena is primarily about mental strength. The way we prepare, strategize, and handle pressure largely determines success. Physical ability matters, but it's the mind that drives us to push harder, stay focused, and adapt to unexpected situations during competition. Mental fortitude, visualization, and the capacity to overcome setbacks are crucial.

Surround yourself with those who push you to he better, and work on the mental game as well. It’s the most critical part.

